  description: Run a data science notebook sample with the IntelÂ® oneAPI AI Analytics Toolkit.
  introduction: |-
    ### This quick start details how to develop using the IntelÂ® oneAPI AI Analytics Toolkit.

    The IntelÂ® oneAPI AI Analytics Toolkit (AI Kit) gives data scientists, AI developers, and researchers familiar Python tools and frameworks to accelerate end-to-end data science and machine learning pipelines on IntelÂ® architectures.

    The components are built using oneAPI libraries for low-level compute optimizations.

    This toolkit maximizes performance from preprocessing through machine and deep learning phases and provides interoperability for efficient model development and deployment across single and multinode environments.

    This quick start covers how to run a data science notebook sample with IntelÂ® AI Analytics Toolkit optimizations. It also walks you through how to load your own notebook with IntelÂ® AI Analytics Toolkit drop-in accelerations for your own workloads or tasks.
  tasks:
    - title: Ensure an AIKit Notebook ImageStream is created
      description: |-
        ### Administrator steps
        #### This is only required the first time
        1. Install the IntelÂ® oneAPI AI Analytics Toolkit Operator if it's not installed
        2. Change namespace to redhat-ods-applications
        3. Select the IntelÂ® oneAPI AI Analytics Toolkit Operator. This can be found in the UI under Operators > Installed Operators > IntelÂ® oneAPI AI Analytics Toolkit Operator
        4. Go to the "AIKitContainer" tab
        5. Click create
        6. The AIKit Notebook ImageStream will be created.
      review:
        instructions: |-
          #### The AIKit Notebook ImageStream is now available
          Has the ImageStream created?
          Inspect under Builds > ImageStreams (the submenu item) > oneapi-aikit
        failedTaskHelp: This task is not verified yet. Try the task again.
    - title: Launch Jupyter workbench
      description: |-
        ### Important considerations
        Use the **Intel oneAPI AI Analytics Toolkit** notebook with the **Large** container size.

        This triggers pulling the IntelÂ® oneAPI AI Analytics Toolkit container. Once the pulling is complete, you are presented with a Jupyter notebook environment.
      review:
        instructions: |-
          #### Launched Jupyter workbench
          Do you have a notebook browser tab?
        failedTaskHelp: This task is not verified yet. Try the task again.
      summary:
        success: You have a workbench
        failed: Review the "Creating a basic workbench" quick start for additional help.
    - title: Review the IntelÂ® oneAPI AI Analytics Toolkit Welcome Message
      description: |-
        ### Review the IntelÂ® oneAPI AI Analytics Toolkit Welcome Message
        1. Double-click the `AI_Kit_Welcome.ipynb` notebook that is available in the IntelÂ® oneAPI AI Analytics Toolkit directory to open it in a new tab, if not already an open tab.
        2. Review the contents of the AI Kit welcome message and its resources.
      review:
        instructions: |-
          #### Reviewed the IntelÂ® oneAPI AI Analytics Toolkit Welcome Message
          Do you have the AI Kit welcome message open?
        failedTaskHelp: This task is not verified yet. Try the task again.
      summary:
        success: You have opened the IntelÂ® oneAPI AI Analytics Toolkit welcome message and read its contents.
        failed: Try the steps again.
    - title: Load a IntelÂ® oneAPI AI Analytics Toolkit sample notebook
      description: |-
        ### Loading a IntelÂ® oneAPI AI Analytics Toolkit sample notebook
        1. Click on the `oneAPI-samples.git` directory. As part of the IntelÂ® oneAPI AI Analytics Toolkit on Red Hat OpenShift AI, we have provided you three examples to help you get started with different AI Kit optimizations.
        2. Click on the `E2E_use_case_with_Intel_optimized_XGBoost_daal4py` directory, then click on the `IntelPython_XGBoost_daal4pyPrediction.ipynb` notebook.
        3. Choose the `Intel SKLearn, XGBoost, & Modin`  Jupyter Kernel Environment to launch the notebook in.
      review:
        instructions: |-
          #### Verify that the notebook launched successfully
          Do you have a notebook tab for the `IntelPython_XGBoost_daal4pyPrediction.ipynb` notebook in your browser in the `Intel SKLearn, XGBoost, & Modin`  Jupyter Kernel Environment?
        failedTaskHelp:
          This task is not verified yet. Try the task again.
      summary:
        success: You loaded the example notebook in the correct AI Kit Jupyter Kernel environment.
        failed: Try the steps again.
    - title: Run an IntelÂ® oneAPI AI Analytics Toolkit sample notebook
      description: |-
        ### Running an IntelÂ® oneAPI AI Analytics Toolkit sample
        1. Run the `IntelPython_XGBoost_daal4pyPrediction.ipynb` notebook cell by cell, taking care not to skip any steps. Once you have completed the entire notebook, you will have learned about some AI Kit optimizations and fundamentals.
        2. (Optional) You can proceed with this step and the previous step with any of the either samples in the correct AI Kit Jupyter Kernel environment to learn more about other AI Kit optimizations. Use the `Intel SKLearn, XGBoost, & Modin` Jupyter Kernel Environment for the `IntelPython_XGBoost_daal4pyPrediction.ipynb` notebook example, and the `Intel TensorFlow & Quantization` Jupyter Kernel Environment for the `lpot_sample_tensorflow.ipynb` notebook example.
      review:
        instructions: |-
          #### Verify that the sample notebook ran successfully
          Did all cells of the notebook run successfully and printed out the statement "[CODE\_SAMPLE\_COMPLETED\_SUCCESSFULLY]" at the end?
        failedTaskHelp:
          This task is not verified yet. Try the task again.
      summary:
        success: You have run the example notebook in the correct AI Kit Jupyter Kernel Environment.
        failed: Try the steps again.
    - title: Load IntelÂ® oneAPI AI Analytics Toolkit optimizations with a new notebook
      description: |-
        ### Load IntelÂ® oneAPI AI Analytics Toolkit optimizations with a new notebook
        1. Enter the Jupyter launcher page.
        2. Select the appropriate Jupyter Kernel Environment notebook for the workload or task you would like to complete and launch it in a new tab. Refer to the `AI_Kit_Welcome.ipynb` notebook for more information on what optimizations are included in each of the AI Kit Jupyter Environment Kernels.
        3. Proceed with your workload or task in your new notebook.
      review:
        instructions: |-
          #### Verify that the notebook launched successfully
          Do you have a new notebook tab in your browser with your selected AI Kit Jupyter Environment Kernel?
        failedTaskHelp:
          This task is not verified yet. Try the task again.
      summary:
        success: You have loaded a new notebook in your selected AI Kit Jupyter Environment Kernel.
        failed: Try the steps again.
  conclusion: You are now able to run samples and create and run original notebooks and workloads using IntelÂ® oneAPI AI Analytics Toolkit. Refer to the `AI_Kit_Welcome.ipynb` for more resources and information on IntelÂ® oneAPI AI Analytics Toolkit.
